import React, {Component} from 'react';
import styled from 'styled-components';
import AOS from 'aos';
import 'aos/dist/aos.css';

const Container = styled.div`
overflow: hidden;
justify-content: space-between;
padding-bottom:10vw;
color:white;
font-family:arial;

    @media (min-width: 1px) and (max-width: 426px) {

      }
`

const ContentContainer = styled.div`
padding-bottom:10vw;
color:white;
font-family:arial;
display:flex
    @media (min-width: 1px) and (max-width: 426px) {

      }
`

const LeftContainer = styled.div`
padding-bottom:10vw;
color:white;
font-family:arial;
    @media (min-width: 1px) and (max-width: 426px) {

      }
`

const RightContainer = styled.div`
padding-bottom:10vw;
color:white;
font-family:arial;
    @media (min-width: 1px) and (max-width: 426px) {

      }
`

const MainHeading =styled.h1`
font-size: 8vw;
text-align:center;
font-weight:bolder;
overflow:hidden
    margin: 15vw 0% 15vw 0%;
@media (min-width: 1px) and (max-width: 426px) {
  font-size: 10vw;
  margin: 15vw 0% 15vw 0%;
   }
`

const MainHeadingContainer = styled.div`
  overflow: hidden;
      @media (min-width: 1px) and (max-width: 426px) {

        }
  `

class Form extends Component {
  componentDidMount(){
    AOS.init({
      duration : 1000
    })
  }
render() {

    return (

      <Container >
        <MainHeadingContainer>
        <MainHeading data-aos='slide-up'>SAY HI</MainHeading>
        </MainHeadingContainer>
      <ContentContainer>
      <LeftContainer>
            1
          </LeftContainer>
          <RightContainer>
            2
          </RightContainer>
      </ContentContainer>

      </Container>
  );
  }
}

export default Form;
